import './Auction.css';
import Product from './Product';
import { useState } from "react";


function Auction() {
    const [posts, setPosts] = useState([]);
        const fetchProducts = () => {
            fetch('http://localhost:5001/api/v1/showBids/9a4449ec-b15a-4ca8-806a-f4d1bbb6375f', {
                method: 'GET'
            })
                .then((response) => response.json())
                .then((data) => {
                    setPosts(data);
                    console.log(posts.product.productName);
                })
                .catch((err) => {
                    console.log(err.message);
                });
        };
        fetchProducts();

    return (
        <div>
            <Product
                productName={posts.product.productName}
                shortDescription={posts.product.shortDescription}
                startPrice={posts.product.startPrice}></Product>

        </div>

    );
}

export default Auction;
